$("#carouselExample").on("slide.bs.carousel",function(e){var o=$(e.relatedTarget),a=o.index(),l=$(".carousel-item").length;if(a>=l-3)for(var r=4-(l-a),t=0;t<r;t++)"left"==e.direction?$(".carousel-item").eq(t).appendTo(".carousel-inner"):$(".carousel-item").eq(0).appendTo(".carousel-inner")}),$("[data-toggle=tooltip]").tooltip();